import React from "react";
import Video from "../components/Video";
import VideoContainer from "../components/VideoContainer";


function Room() {
  //console.log(props);
  const myVideo = navigator.mediaDevices.getUserMedia({
    audio: true,
    video: true,
  });
  const peerVideos = [
    {
      key: 1,
      name: "SSam"
    },
    {
      key: 2,
      name: "SSong"
    },
    {
      key: 3,
      name: "Song"
    }
  ];
  return (
    <div>
      <h1>OrchestLive!</h1>
      <div className="call">
        <h1>Room Name : </h1>
        <h3>Client : </h3>
        <VideoContainer l={myVideo.length} streamArray={myVideo} myStream={myVideo}>
        <Video stream={myStream} autoPlay></Video>
          
        </VideoContainer>
        
        <button className="mute">Mute</button>
        <button className="camera">Turn Camera Off</button>
        
        <div>
          <button className="out">Remove</button>
        </div>
      </div>
    </div>
  );
  
  
}

export default Room;

